for i in range(len([item["close"] for item in DATA])):
  hist_indexes.append(i)

for i in range(len(RSI_14)):
  if RSI_14[i] > 50 and can_buy and EMA[i] < [item["close"] for item in DATA][i] and histogram[i - 1] < 0 and histogram[i] > 0:
    arr.append({"x": i, "y": [item["close"] for item in DATA][i], "color": 'green'})
    can_buy = False
  if macd_line[i-1] > macd_signal[i-1] and macd_line[i] < macd_signal[i] and RSI_14[i] > 50 and macd_line[i] > 0 and macd_signal[i] > 0 and not can_buy:
    arr.append({"x": i, "y": [item["close"] for item in DATA][i], "color": 'red'})
    can_buy = True

if len(arr) > 0 and arr[len(arr)-1]['color'] == 'green':
  arr = arr[:len(arr)-1]

fig, (ax1, ax2, ax3) = plt.subplots(3, sharex=True)
ax1.plot([item["close"] for item in DATA])
ax1.plot(EMA)
ax1.scatter([item["x"] for item in arr], [item["y"] for item in arr], c=[item["color"] for item in arr])

ax2.plot(RSI_14)
ax2.axhline(y=70, color="r", linestyle="--")
ax2.axhline(y=50, color="black", linestyle="--")
ax2.axhline(y=30, color="g", linestyle="--")

color = ["red" if cl < 0 else "green" for cl in histogram]

ax3.plot(macd_line)
ax3.plot(macd_signal, '--')
ax3.bar(hist_indexes, histogram, color=color)

count_of_positive_trades = 0
highest_win_trade = 0

for i in range(len(arr)):
  if arr[i-1]['color'] == 'green' and arr[i]['color'] == 'red' and arr[i-1]['y'] < arr[i]['y']:
    count_of_positive_trades += 1
  if arr[i-1]['color'] == 'green' and arr[i]['color'] == 'red' and arr[i-1]['y'] < arr[i]['y']:
    if arr[i]['y'] - arr[i-1]['y'] > highest_win_trade:
      highest_win_trade = arr[i]['y'] - arr[i-1]['y']

if len(arr) > 0:
  print(f"Win rate: {round((count_of_positive_trades / (len(arr) / 2)) * 100, 2)}%")
else:
  print(f"Win rate: 0%")
  
print(f"Highest win: {highest_win_trade}")

plt.show()